create table databasedictionary
(
    dictionaryid integer      not null
        constraint databasedictionary_pkey
            primary key,
    fieldid      smallint     not null
        constraint databasedictionary_fieldid_fkey
            references databaseschema,
    attributeid  integer      not null,
    attribute    varchar(120) not null
);

alter table databasedictionary
    owner to postgres;

